import React, {Component} from 'react'
import './Sidebar.css'
import arrow from './Photos/arrow.png'

class Sidebar extends Component{
    render(){
        return(
            <div className="sidebar">
                <img src={arrow}/>
                <h2>karen's food adventures</h2>
            </div>
        )
    }
}

export default Sidebar
